import React from 'react';

const About: React.FC = () => (
  <section style={{ padding: '2rem' }}>
    <h1>About</h1>
    <p>This project provides a web-based platform for nail segmentation and annotation, built with React and TypeScript.</p>
  </section>
);

export default About;
